// DeleteUniqueIndexCache 删除索引存在的缓存
func (w *WxGzhUserRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.WxGzhUser) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, w.cache.Key(CacheWxGzhUserByConditionPrefix))
	keys = append(keys, w.cache.Key(CacheWxGzhUserUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[w.cache.Key(CacheWxGzhUserByIDPrefix, item.ID)] = struct{}{}
			KeyMap[w.cache.Key(CacheWxGzhUserUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[w.cache.Key(CacheWxGzhUserByAppIDOpenidPrefix, item.AppID, item.Openid)] = struct{}{}
			KeyMap[w.cache.Key(CacheWxGzhUserUnscopedByAppIDOpenidPrefix, item.AppID, item.Openid)] = struct{}{}
			KeyMap[w.cache.Key(CacheWxGzhUserByAppIDPrefix, item.AppID)] = struct{}{}
			KeyMap[w.cache.Key(CacheWxGzhUserUnscopedByAppIDPrefix, item.AppID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := w.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
